--values (8, 'Places', 'Lugares', 8);
drop table if exists tbl_points;
drop table if exists tbl_point_types;

alter table tbl_indicators add column if not exists show_points boolean not null default false;
alter table tbl_indicators add column if not exists show_report boolean not null default false;

update tbl_indicators set show_points = true where id_ in (77, 119);
update tbl_indicators set show_report = true where id_ in (77, 119);

create table if not exists tbl_point_types (
	id_ numeric primary key,
	name_en text not null,
	name_es text not null,
	sort_order numeric not null,
	color text not null
);

create table if not exists tbl_points (
	id_ bigint primary key generated always as identity,
	point_type_id numeric not null references tbl_point_types,
	year_ text not null,
	value_ numeric,
	feature_properties_en json,
	feature_properties_es json,
	geojson json not null
);
alter table tbl_points add column if not exists value_label_en text;
alter table tbl_points add column if not exists value_label_es text;

create table if not exists tbl_location_report (
	location_id text not null,
	location_type_id numeric not null,
	year_ text not null,
	report_data json not null
);

delete from tbl_points;
delete from tbl_point_types;
on conflict do nothing;



